// src/pages/ChemistScan.js
import React, {useState} from "react";
import { scanDispense } from "../services/api";

export default function ChemistScan(){
  const [code, setCode] = useState("");
  const [out, setOut] = useState(null);

  async function doScan(){
    const res = await scanDispense(code, "C001");
    setOut(res);
  }

  return (
    <div style={{padding:20}}>
      <h2>Chemist: Scan & Dispense</h2>
      <p>(Paste prescription QR text here, eg: RX:RXabc123)</p>
      <input style={{width:'60%'}} value={code} onChange={e=>setCode(e.target.value)} />
      <button onClick={doScan}>Process</button>
      <pre>{out && JSON.stringify(out, null, 2)}</pre>
    </div>
  );
}
